import React, { Component } from 'react';
import { Media, Player } from 'react-media-player'
import './songslist.css';
import './App.css';


export default class Honey extends Component {
  constructor(props) {
    super(props);
    this.state = {
      songs_list: [],
      song: ""

    }
  }
  componentDidMount() {
    fetch("http://localhost:8012/honey_songs")
      .then(response => response.json())
      .then(responseJson => {
        this.setState({
          songs_list: responseJson
        })
      })
  }
  render() {
    return (
      <Media>
        <div >
          <div lassName="list1" style={{ marginTop: 40,marginLeft: -10 }}>

            {this.state.songs_list.map((s) => (
              <ul>
                <button className="semi-transparent-button" style={{ marginLeft: -30, marginTop: 20 }}
                  onClick={() => {
                    this.setState({
                      song: "http://localhost:8012/gethoney_song?song_name=" + s.name
                    })
                  }}>
                  {s.name}
                </button>
              </ul>
            ))}
          </div>
        </div>

      </Media >

    )
  }
}
